import React, { useState } from 'react';

function Login_page() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleLogin = (e) => {
    e.preventDefault();
    
    // Ваш код для обработки входа, например, отправка данных на сервер
    console.log('Email:', email);
    console.log('Password:', password);
  };

  return (
    <div className="regis" id="mylogin">
      <div className="form-login">
        <h2>Войти</h2>
        <p>Добро пожаловать в Додо пиццу!</p>
        <form onSubmit={handleLogin}>
          <input
            name="email"
            type="email"
            id="myemail"
            placeholder="Введите почту"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
          <input
            name="pass"
            type="password"
            id="mypass"
            placeholder="Введите пароль"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
          <div className="remember">
            <a href="#">Забыли пароль?</a>
          </div>
          <button type="submit" className="btn">
            Войти
          </button>
        </form>
        <p className="or">----Войти через соцсети-----</p>
        <div className="icons">
          <i className="itg"><img src="bxl-telegram.svg" alt="" /></i>
          <i className="ivk"><img src="bxl-vk.svg" alt="" /></i>
          <i className="iin"><img src="bxl-instagram.svg" alt="" /></i>
        </div>
        <div className="login-regis">
          <div name="error" id="error"></div>
          <p>
            Нет аккаунта? 
            <a href="#" className="reg-lin" id="openregistr">
              Зарегистрироваться
            </a>
          </p>
        </div>
        <button className="closelogin" id="closedlogin">X</button>
      </div>
      <div className="overloylogin" id="closed2login"></div>
    </div>
  );
}

export default Login_page;
